rization:</h3></span> I authorize: any licensed physician, medical practitioner or care provider; any hospital; clinic; treatment facility; pharmacy or pharmacy benefit managers; or other medical or medically related facility; any insurance company or reinsurer; the MIB consumer reporting agency; financial agency; or employer who has knowledge of me; my personal characteristics; or my health (or of any other person who is here proposed for insurance); to give, in any format, including, but not limited to paper and/or electronic, that information requested pertaining to my health or personal characteristics to be used to determine my insurability and/or any benefits in the event of a claim to the Medical Director of the Nationwide or its subsidiaries; affiliates; or sub-contractors; including, but not limited to, RSA Medical, or its reinsurers, for the purpose of underwriting my application in order to determine eligibility for Life Insurance and to investigate claims. I understand that the aforementioned parties requesting access to my (electronic or paper) medical records are acting as a patient authorized representative and will attempt to access my medical records in the most efficient manner possible, including electronic interchange through a health information exchange or directly through my providers’ electronic health record system. I also authorize Nationwide to make a brief report of my health information, including personal health information and protected health information, to MIB, Inc. By my signature below, I acknowledge that any agreements I have made to restrict my protected health information do not apply to this form; and I instruct any physician; health care professional; hospital; clinic; pharmacy or pharmacy benefit managers; medical facility; or other health care provider to release and disclose my entire medical/ health record without restriction. I understand that any information that is disclosed pursuant to this form may be redisclosed and no longer be covered by federal rules governing privacy and confidentiality of health information. This form, or a copy of it, will be valid for a period of not more than two and one-half years (30 months) from the date it was signed. I understand that I have the right to revoke this form in writing, at any time, by sending a written request for revocation to Nationwide, Attention: Underwriting, P.O. Box 182835, Columbus, Ohio 43218-2835. I understand that a revocation is not effective to the extent that any of my providers have relied on this form; or to the extent that Nationwide any has a legal right to contest a claim under an insurance policy or to contest the policy itself. I further understand that if I refuse to sign this form to release my complete records, or, if I revoke this authorization before a policy is issued, Nationwide may not be able to process my application. I understand that my authorized representative or I have a right to a copy of this form by sending a request to Nationwide in writing.\",\"parent_question_answer\":{\"questions\":[{\"answer\":[\"AZ\"],\"operator\":\"AND\",\"question_id\":\"State\"}],\"operator\":\"AND\"},\"question_status_message\":\"\"}',1,'Personal','{\"questions\":[{\"answer\":[\"AZ\"],\"operator\":\"AND\",\"question_id\":\"State\"}],\"operator\":\"AND\"}','2021-03-08 07:38:17',NULL,1,1,1,4,0,1,1,1,1),(471,'fb248654-ae37-4cba-b350-d41a19e00510','questions',1,10,5,'HippaAuthorization','{\"question_id\":\"HippaAuthorization\",\"question_type\":\"multiselection\",\"display_type\":\"checkbox\",\"orientation\":\"rows\",\"question_text\":\"\",\"question_description\":\"\",\"index\":1,\"response\":\"\",\"sequence_number\":1,\"is_reviewable\":true,\"is_editable\":true,\"is_edit_icon_visible\":true,\"is_hidden\":false,\"presentation_type\":\"\",\"validations\":{\"required\":{\"value\":true,\"error_message\":\"This is a required field.\"}},\"response_options\":[{\"id\":\"HippaAuthorizationYes\",\"label\":\"I have read the <a moda